import styled from "styled-components";

export const NavBar = () => {
    return  (
        <div>
            <NavContainer>
                <a href= "/todo">todo</a>
                <a href= "/about">about</a>
            </NavContainer>
        </div>
    )
}

const NavContainer = styled.div`
    padding-left: 100px;
    padding: 10px;
    background-color:rgb(203, 219, 247);
`
